import nltk
#defining Contex Free Grammar
grammar = nltk.CFG.fromstring("""
    T2 -> T9 T9 T5 T5 T7 T4 T5 '57' '65' '67' '70' '65' '67' '67' '65' '62' '65' '62' '67' T8 '55' '65' T8 '60' T8 '57' '55' '53' T7 '65' '60' '62' T9 '55' '57' '59' '60' '64' '65' '68' '69' '71' '72' '77' T6 T6 T6 '$'
	T3 -> '53' '57' '60' '67' '65' '67' '65' '67' '65' '67' '65' '63' '62' '60' 
	T4 -> '57' '57' '60' '62' '55' '55' '57' '58' '65' '65' '64' '60' '62' '60' '58' '57' '60' '62' '62' '62' '67' '65' '64' '65' '62' '60' '53' '55' '57' '62' '60' '60' '58' '57' '52' '53' 
	T5 -> '53' '65' '62' '62' '60' '60' '58' '62' '65' '62' '65' '58' '65' T8 '60' T8 '57' '55' '53' 
	T6 -> T3 T3 T3 T3 T3 T3 
	T7 -> '57' '60' '62' '63' '63' '64' '65' '67' '67' '60' '62' 
	T8 -> '62' '60' '58' 
	T9 -> '60' T4    
  """)

sentence = '60 57 57 60 62 55 55 57 58 65 65 64 60 62 60 58 57 60 62 62 62 67 65 64 65 62 60 53 55 57 62 60 60 58 57 52 53 60 57 57 60 62 55 55 57 58 65 65 64 60 62 60 58 57 60 62 62 62 67 65 64 65 62 60 53 55 57 62 60 60 58 57 52 53 53 65 62 62 60 60 58 62 65 62 65 58 65 62 60 58 60 62 60 58 57 55 53 53 65 62 62 60 60 58 62 65 62 65 58 65 62 60 58 60 62 60 58 57 55 53 57 60 62 63 63 64 65 67 67 60 62 57 57 60 62 55 55 57 58 65 65 64 60 62 60 58 57 60 62 62 62 67 65 64 65 62 60 53 55 57 62 60 60 58 57 52 53 53 65 62 62 60 60 58 62 65 62 65 58 65 62 60 58 60 62 60 58 57 55 53 57 65 67 70 65 67 67 65 62 65 62 67 62 60 58 55 65 62 60 58 60 62 60 58 57 55 53 57 60 62 63 63 64 65 67 67 60 62 65 60 62 60 57 57 60 62 55 55 57 58 65 65 64 60 62 60 58 57 60 62 62 62 67 65 64 65 62 60 53 55 57 62 60 60 58 57 52 53 55 57 59 60 64 65 68 69 71 72 77 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 53 57 60 67 65 67 65 67 65 67 65 63 62 60 $'.split()
def parse(sent):
    #Returns nltk.Tree.Tree format output
    a = []
    parser = nltk.ChartParser(grammar)
    for tree in parser.parse(sent):
        a.append(tree)
    return(a[0])

#Gives output as structured tree
print(parse(sentence))

#Gives tree diagrem in tkinter window
parse(sentence).draw()